  Quando o trabalhador exerce suas atividades em locais que estão acima de 2 metros do nível inferior, seja o solo ou não, é considerado trabalho em altura. O que regula essa área é a Norma Regulamentadora n.º 35 (NR 35). O trabalho realizado sob essas condições tem alguns riscos, como por exemplo quedas de escadas ou andaimes, são comuns, infelizmente.   Toda atividade requer cuidados e equipamentos específicos, priorizando a segurança e o bem estar dos colaboradores. A melhor maneira de evitar acidentes é seguindo as disposições da NR 35. O que dará segurança para os funcionários mas também para organização que garante estar cumprindo todas as diretrizes. É essencial que haja capacitação e treinamento de todos os empregados que trabalharão nas atividades em altura. A carga horária deve ser de 8 horas  A NR 35 lista responsabilidades tanto do patrão quanto dos empregados para garantir a proteção de todos que frequentam o local de trabalho. Estas são algumas das obrigações do empregador:</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>garantir que sejam implementadas as medidas de proteção da NR;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>desenvolver um procedimento de operações para as atividades em altura;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>acompanhar o cumprimento das medidas de proteção da NR e das empresas de segurança do trabalho;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>garantir que os empregados tenham informações atualizadas sobre os riscos da atividade e de todas as medidas de segurança;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>assegurar que o trabalho em altura seja sempre feito sob supervisão, de acordo com a análise de riscos e a atividade bem como um plano de resgate de vítimas de eventual acidente.</b></span></font></div><div style=\"text-align: left;\">        </div><div style=\"text-align: left;\"><b style=\"font-size: 12px; color: rgb(119, 119, 119); font-family: Arial;\">Já para os empregados, essas são algumas responsabilidades:</b></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>cumprir todas as disposições da lei e das normas a respeito do trabalho em altura, inclusive as obrigatoriedades que o empregador impõe;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>colaborar sempre com o empregador garantindo que as medidas de segurança estejam sendo implementadas;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>interromper suas atividades sempre que for constatada uma evidência de riscos graves para a sua segurança e saúde bem como demais envolvidos;</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><span style=\"white-space:pre\">	</span>•<span style=\"white-space:pre\">	</span>zelar pela própria segurança e também das outras pessoas que frequentam os locais em que há trabalho em altura.</b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b><br></b></span></font></div><div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b>Para que todas as medidas sejam eficazes também é necessário o uso de EPI’S, alguns mais genéricos outros específicos, como cinto de segurança do tipo paraquedista; trava quedas; talabartes (ajustáveis, simples e duplos tipo Y);linhas de vida vertical e horizontal; ancoragens; capacete com jugular; botina; luva de segurança.</b></span></font></div>', 1, '2020-08-24 14:53:16', '2020-08-24 17:18:37', NULL),
(9, 'Sinais de um AVC', '202012091645305fd1295ad3a76.jpg', 'Getra', '<p>-</p>', '<p><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 13.5pt; line-height: 19.26px; font-family: Arial, sans-serif; color: rgb(68, 68, 68);\"><o:p>&nbsp;</o:p></span><span style=\"font-family: Arial, sans-serif; font-size: 10.5pt;\"><span style=\"font-family: Arial;\">O AVC decorre da alteração do fluxo de sangue ao cérebro. Responsável pela morte de células nervosas da região cerebral atingida, o AVC pode se originar de uma obstrução de vasos sanguíneos, o chamado acidente vascular isquêmico, ou de uma ruptura do vaso, conhecido por acidente vascular hemorrágico. Cerca de 70% das pessoas que sofrem um derrame não retorna ao trabalho depois do acidente vascular cerebral e 50% ficam dependentes de outras pessoas.</span><br><br><span style=\"font-family: Arial;\">Alguns sintomas podem ser percebidos e tendo conhecimento deles fica mais fácil procurar ajuda o quanto antes, são eles:</span><br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\"><br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Dificuldade para falar;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Perda de visão;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Perda da sensibilidade de um lado do corpo;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Alterações motoras;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Paralisia de um lado do corpo;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Distúrbio de linguagem;<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Distúrbio sensitivo<br></span><span style=\"font-size: 11.5pt; font-family: Arial, sans-serif;\">- Alteração no nível de consciência.<br><br>Estar atento a esses sintomas pode salvar a sua vida. É possível evitar um AVC mantendo um estilo de vida saudável, tendo uma alimentação baseada em nutrientes e mantendo atividades físicas regulares, isso possibilita a diminuição de casos.</span><br></p>', 1, '2020-12-09 19:45:30', '2020-12-09 19:45:30', NULL),
(10, 'Medicina do trabalho: exames ocupacionais', '2021061513544960c8db59e6c35.jpg', 'Quais exames são obrigatórios?', '<p>GETRA</p>', '<p>Os exames ocupacionais são obrigatórios e estão previstos na legislação trabalhista, regulamentada pela Portaria nº 3214. As empresas tem a obrigação de garantir acesso de seus funcionários a medicina do trabalho, podendo haver sanções caso haja o descumprimento da norma e o atraso nos prazos previstos em lei.</p><p>O ASO Atestado de Saúde Ocupacional, será expedido para comprovar se o funcionário está apto ou não a exercer suas funções. Geralmente esse tipo de trabalho é terceirizado, ou seja, as organizações contratam empresas especializadas em Saúde e Segurança do Trabalho para realizar estes exames. É de suma importância que a empresa seja especializada para que possa orientar o setor de Recursos Humanos nas dúvidas que surgem no dia a dia.</p><p>O ASO é o exame realizado nos seguintes cenários: Admissional, Demissional, Periódico, Mudança de função e Retorno ao trabalho. Além disso, dependendo da função exercida e dos riscos ocupacionais envolvidos no posto de trabalho, outros exames complementares devem ser realizados, conforma as normas regulamentadoras NR 7 e NR 9. Mas esses 5 mencionados anteriormente são obrigatórios de serem realizados, respeitando os prazos previstos em lei.</p><p>Admissional - Esse exame tem como função atestar se o colaborador que está sendo contratado está apto no momento da contratação, para determinada função.</p><p>Demissional - O exame deve ser realizado quando o colaborador é desligado da empresa.</p><p>Periódico - A periodicidade desse exame varia de acordo com a idade e as condições de trabalho as quais o colaborador é exposto.</p><p>Mudança de função - Esse exame deve ser feito sempre que a mudança de local ou função de trabalho exponha o funcionário a riscos diferentes do cargo anteriormente ocupado.</p><p>Retorno ao trabalho - Sempre que o funcionário se afastar da empresa por mais de 30 dias por motivo de doença ou licença-maternidade, esse exame deve ser realizado.</p><p>A medicina do trabalho é importante tanto na vida do colaborador como na vida da empresa. Seguir as normas vai além de cumprir meramente regras, com todas essas ações aliadas a outras práticas é possível preservar vidas, além de manter a reputação da empresa. Empresa e colaborador só tem a ganhar com as medidas certas sendo implementadas.</p>', 1, '2021-06-15 16:54:50', '2021-06-15 16:54:50', NULL),
(11, 'O que é o Exame Admissional?', '2021070610254660e459da4c0f1.jpg', 'Saiba mais', '<p>Getra</p>', '<p>O Exame Admissional é previsto na CLT, onde os empregadores são obrigados a realizar esse exame nos novos colaboradores. Exames de aptidão física e mental que possibilitem atestar se aquele colaborador está apto a exercer as funções as quais ele está sendo contratado. Essa avaliação também deve ser feita com periodicidade enquanto o colaborador fizer parte do grupo de funcionários e no possível desligamento também. Todos esses exames estão previstos no ASO - Atestado de Saúde Ocupacional.</p><p>Com esse exame tanto a empresa quanto o colaborador ficam respaldados, ou seja isso garante a segurança de ambos para a execução das funções.</p><p>Pois bem o Admissional deve ser feito em até 15 dias da contratação do funcionário. Nesse processo são avaliados a pressão arterial, batimentos cardíacos, o histórico de doenças familiares, em alguns casos dependendo da função exames como o de visão e audição também podem ser solicitados.</p><p>Todo o exame que conste no Atestado de Saúde Ocupacional deve ser realizado por uma empresa especializada em Saúde e Segurança do Trabalho. Com toda segurança e profissionalismo, para garantir a segurança da empresa e do colaborador. </p>', 1, '2021-07-06 13:25:46', '2021-07-20 13:12:54', NULL),
(12, 'Você sabe o que é EPC?', '2021072010150260f6cc5650025.jpg', 'Saiba mais', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">EPC –\r\nEquipamento de Proteção Coletiva são equipamentos fornecidos pela empresa para\r\na segurança dos colaboradores, protegendo dos riscos oferecidos pelo tipo de\r\ntrabalho executado. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Os EPC’s tem\r\ncomo objetivo prevenir os trabalhadores ou terceiros que transitem no ambiente;\r\nminimizar perdas e assim aumentar a produtividades, justamente porque a partir\r\ndo momento que os trabalhadores estão em local seguro sua produtividade\r\naumenta.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Além do que\r\nestá disposto na NR 01, existem também as normas NR 04 e 09 que também dispõem\r\ndas obrigatoriedades relativas ao uso de EPC’s.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Deve ser\r\nfeita uma avaliação de riscos para assim determinar quais são os equipamentos\r\nque devem ser usados. Abaixo citaremos alguns exemplos:<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Cones<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Fitas<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Placas de\r\nsinalização<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Alarmes<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Plataformas<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Grades<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Guarda\r\ncorpo<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Extintores\r\nde incêndio <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Corrimão<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Exaustores <o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">- Barreiras\r\ncontra luminosidade e radiação entre outros.<br><br>Manter a segurança no ambiente de trabalho faz toda a diferença. Invista em Saúde e Segurança do Trabalho.</span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><o:p></o:p></span></p>', 1, '2021-07-20 13:15:02', '2021-07-20 13:15:02', NULL),
(13, 'NR 33 - Espaços Confinados', '20210728143249610194c1e5604.jpg', 'Você sabe o que é?', '<p>Getra</p>', '<p>A Norma Regulamentadora 33, trata de espaços confinados. Desde 2006 foi criada a portaria que prevê a NR 33. Essa norma atua diretamente no estabelecimento de espaços confinados, ou seja, avalia, monitora e controla os riscos existentes.</p><p>Segundo essa norma, o espaço confinado é qualquer ambiente ou área não projetado para ocupação humana contínua, apresentando meios limitados de entrada e saída. As principais atividades que apresentam esse trabalho, é a construção civil e indústria.</p><p>A NR 33 determina que além dos trabalhadores técnicos que são devidamente autorizados para a função, é necessário contar com: responsável técnico, supervisor de entrada e vigia. Tudo isso para garantir a segurança dos envolvidos. Por se tratar de uma área que apresenta periculosidade, os trabalhadores precisam passar por uma capacitação que fica a cargo do empregador oferecer.&nbsp;</p><p><span style=\"color: rgb(38, 38, 38); font-family: Nunito;\">Medidas de segurança como sinalização e isolamento da área, PET, equipamentos medidores de oxigênio, medidores de gases tóxicos e equipamentos de ventilação, são necessários.</span><br></p><p>Cada vez mais fica em evidencia a necessidade de investir em saúde e segurança do trabalho, garantindo segurança para o empregador e seus colaboradores. Por isso as NRs são estabelecidas e precisam ser cumpridas, conforme determinam o seu texto.</p><p><br></p>', 1, '2021-07-28 17:32:49', '2021-07-28 17:32:49', NULL),
(14, 'Exame de retorno ao trabalho', '202108110940196113c533b4fb1.jpg', 'Saiba mais', '<p>Getra</p>', '<p>O exame de retorno ao trabalho faz parte da serie de exames ocupacionais que precisam ser realizados pelos colaboradores. Esse exame deve ser realizado no primeiro dia de retorno do trabalhador, após ele ter permanecido afastado por período igual ou superior a 30 dias, sendo o motivo acidente ou doença, sejam ocupacionais ou não.&nbsp;</p><p>A norma que regulamenta os exames ocupacionais é a NR 7 e estabelece a obrigatoriedade do PCMSO - Programa de Controle Médico de Saúde Ocupacional, sendo obrigatório para todas as empresas que possuem funcionários.</p><p>Após o exame, o médico deve emitir um Atestado de Saúde Ocupacional ASO, que também é obrigatório.</p><p>Aqui na Getra nós fazemos os exames ocupacionais da sua empresa. Entre em contato conosco para saber mais.</p>', 1, '2021-08-11 12:40:19', '2021-08-11 12:41:52', NULL),
(15, 'NR 12', '2021092010314861488d4490da8.jpg', 'Getra', '<p>Norma que regulamenta a segurança no trabalho em máquinas e equipamentos<br></p>', '<p style=\"margin-top:0cm;line-height:21.0pt\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">A NR 12 é a Norma Regulamentadora\r\nde Segurança do Trabalho em Máquinas e Equipamentos. Tem como principal\r\nobjetivo de regulamentar e definir padrões de segurança e qualidade nas rotinas\r\nprodutivas que fazem uso de equipamentos, ou seja, garantir a segurança, saúde\r\ne integridade física dos trabalhadores.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">A\r\nNR 12 foi um passo importante para regulamentar os parâmetros de segurança de\r\nsegurança para garantir o bem-estar e a integridade física dos trabalhadores.\r\nEssa norma exige informações completas sobre todo o ciclo de vida de máquinas e\r\nequipamentos, incluindo transportes, instalação, utilização, manutenção e até\r\nmesmo sua eliminação ao final da vida útil.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">Ela\r\ndetermina que cabe ao empregador adotar medidas de proteção capazes de garantir\r\na saúde e a integridade física dos trabalhadores. Enquanto isso, cabe ao\r\nfuncionário:</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">-\r\nCumprir as orientações para uma operação segura.<br>\r\n- Não fazer alterações nas proteções mecânicas ou dispositivos de segurança de\r\nmáquinas e equipamentos.<br>\r\n- Comunicar imediatamente a chefia se algum maquinário for danificado de forma\r\nque possa comprometer a segurança dos envolvidos no trabalho.<br>\r\n- Participar de capacitações e treinamentos para atender às normas de segurança.<br>\r\n- E ainda colaborar com o empregador para fazer valer as disposições da NR 12.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p style=\"margin-top: 0cm; line-height: 21pt;\"><span style=\"font-size: 10.5pt; font-family: Arial, sans-serif;\">A\r\ncapacitação dos colaboradores é de extrema importância para garantir a\r\nsegurança de todos. Conte com uma empresa especializada em Saúde e Segurança do\r\ntrabalho para ajudar a sua empresa. Conte com a Getra.</span><span style=\"font-size: 10.5pt; font-family: &quot;Segoe UI&quot;, sans-serif;\"><o:p></o:p></span></p>', 1, '2021-09-20 13:31:48', '2021-09-20 13:31:48', NULL),
(16, 'Grávidas e lactantes não podem exercer atividades insalubres', '202109281434336153522931e94.jpg', 'Saiba mais', '<p>Getra</p>', '<p><span style=\"font-family: Arial;\">Gestantes e lactantes não podem exercer atividades insalubres, a CLT traz no Art 394-A que \"a empregada gestante será afastada, enquanto durar a gestação, de quaisquer atividades, operações ou locais insalubres e exercerá suas atividades em local salubre, excluído, nesse caso, o pagamento de adicional de insalubridade. Não havendo necessidade de apresentar atestado médico.</span></p><p><span style=\"background-color: rgb(249, 249, 249); font-family: Arial; font-size: 16px;\">§</span><span style=\"background-color: rgb(249, 249, 249); font-family: &quot;Varela Round&quot;; font-size: 16px;\">&nbsp;</span><span style=\"font-family: Arial;\">3º Quando não for possível que a gestante ou a lactante afastada nos termos do caput deste artigo exerça suas atividades em local salubre na empresa, a hipótese será considerada como gravidez de risco e ensejará a percepção de salário-maternidade, nos termos da Lei nº 8.213 de 24 de Julho de 1991, durante todo o período de afastamento. (Incluído pela Lei nº 13.467 de 2017)</span></p><p><span style=\"font-family: Arial;\">Fique atento as normas, caso tenha colaboradoras grávidas ou lactantes na sua empresa, siga todas as normas de segurança descritas em lei.</span></p><p><span style=\"font-family: Arial;\">Uma empresa sem acidentes só depende de você!</span></p><p><span style=\"font-family: Arial;\">﻿</span><br></p>', 1, '2021-09-28 17:34:33', '2021-09-28 17:34:33', NULL),
(17, 'Insalubridade x Periculosidade', '2022031614193362321c2550904.jpg', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:\" arial\",sans-serif\"=\"\"><span style=\"font-family: Arial;\">Algumas\r\natividades quando realizadas expõem o trabalhador a riscos,</span><span style=\"letter-spacing: 0.15pt; font-family: Arial;\">&nbsp;a legislação brasileira pela Consolidação\r\ndas Leis do Trabalho&nbsp;</span></span><a href=\"https://www.contabeis.com.br/trabalhista/clt/\" style=\"outline: none; line-height: inherit; padding: inherit; float: inherit;\"><b><span style=\"color: windowtext; letter-spacing: 0.15pt; font-family: Arial;\">(CLT)</span></b></a><span style=\"letter-spacing: 0.15pt; font-family: Arial;\">&nbsp;garante um tipo proteção ao colaborador com\r\nos adicionais de pagamento chamados de insalubridade ou periculosidade.</span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial; letter-spacing: 0.15pt;\">Ambas devem ser pagas de\r\nforma adicional pelo empregador na&nbsp;</span><span style=\"font-family:\r\n\" arial\",sans-serif\"=\"\"><a href=\"https://www.contabeis.com.br/trabalhista/folha_de_pagamento/\" style=\"outline: none; line-height: inherit; padding: inherit; float: inherit;\"><b><span style=\"color: windowtext; letter-spacing: 0.15pt; font-family: Arial;\">folha de pagamento,</span></b></a><span style=\"letter-spacing: 0.15pt; font-family: Arial;\">&nbsp;mas têm regras, cálculos e características diferentes. Pois bem, vamos explicar um pouco mais sobre esses termos.</span></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial; color: rgb(64, 64, 64); letter-spacing: 0.15pt;\">Aquilo que é considerado insalubre quer dizer que pode\r\ntrazer malefícios à saúde da pessoa, portanto colocaria a saúde do trabalhador\r\nem risco.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"color: rgb(64, 64, 64); font-family: Arial, sans-serif; letter-spacing: 0.15pt;\">A periculosidade também expõe o funcionário a possíveis\r\nriscos, porém este termo está mais ligado à fatalidade da função do que a saúde em\r\nsi. Ou seja, são funções que para serem desempenhadas podem haver risco de vida.</span></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"color: rgb(64, 64, 64); font-family: Arial, sans-serif; letter-spacing: 0.15pt;\">Importante ressaltar que relacionado a remuneração o\r\nmesmo funcionário não pode acumular dois adicionais.&nbsp;</span></p>', 1, '2022-03-16 17:19:33', '2022-03-16 17:21:25', NULL),
(18, 'Atestado de Saúde Ocupacional', '20220405104427624c47bb9eae6.png', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:\" arial\",sans-serif\"=\"\">O ASO –\r\nAtestado de Saúde Ocupacional <span style=\"color: rgb(44, 47, 52); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">é\r\numa declaração médica que indica se o trabalhador está em condições (apto) ou\r\nnão (inapto) de realizar determinadas atividades ou funções dentro de uma\r\nempresa.</span><o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(44, 47, 52); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Esse atestado avalia se a saúde do colaborador está de acordo\r\ncom a exposição de risco que as atividades que ele vai exercer trazem. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">O ASO é obrigatório para todos os empregadores e empresas que\r\ncontratam sob o regime da Consolidação das Leis do Trabalho (CLT). O atestado\r\nde saúde ocupacional deve ser emitido no mínimo em duas vias: uma para o\r\ncontratante e outra para o empregado.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Caso a empresa não realize estará descumprindo as normas e\r\npenalidades serão aplicadas obedecendo a NR 1.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">O ASO é um documento super importante que precisa ser emitido por um\r\nprofissional de Saúde e Segurança do Trabalho habilitado.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Conte com a Getra quando o assunto for Saúde e Segurança do\r\nTrabalho.</span><span style=\"font-family:\" arial\",sans-serif\"=\"\"><o:p></o:p></span></p>', 1, '2022-04-05 13:44:27', '2022-04-05 13:46:10', NULL),
(19, 'Acidentes de Trabalho', '20220509151009627959010a7a8.jpg', 'Precisam ser evitados', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Acidentes de\r\ntrabalho infelizmente são muito comuns e acontecem todos os dias, com lesões\r\nque podem ser desde as temporárias até as permanentes, em alguns casos até\r\nfatais. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Em todas as\r\nesferas os acidentes causam prejuízos, além de ser um dever manter a saúde e\r\nsegurança dos seus colaboradores dentro da empresa, afastamentos por acidentes\r\nde trabalho vão gerar muitos prejuízos para empresa enquanto organização.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Além do\r\npagamento de multas, o colaborador deixa de exercer suas funções, o que faz com\r\nque a empresa tenha custos que podem e devem ser evitados.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Acidentes de\r\ntrabalho podem ser evitados todos os dias, mantendo um ambiente de trabalho\r\nseguro, com uso de EPI’s e conscientização de todos que fazem a empresa, muitos\r\nriscos podem ser minimizados.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Contar com uma\r\nempresa especializada em Saúde e Segurança do Trabalho para ajudar nesse\r\ntrabalho é de extrema importância. Não espere acidentes acontecerem para se prevenir.\r\n<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Entre em\r\ncontato com a Getra por algum de nossos canais e saiba mais:<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">@getragestao / </span><span style=\"font-size: 10.5pt; line-height: 107%; font-family: &quot;Segoe UI Symbol&quot;, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">📞</span><span style=\"font-size: 10.5pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">(83) 3201-1446 / 9 9988-1495</span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><o:p></o:p></span></p>', 1, '2022-05-09 18:10:09', '2022-05-09 18:10:09', NULL),
(20, 'Exame de Espirometria', '202205170825036283860fcfcfa.jpg', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">O exame de <span style=\"color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Espirometria é um exame utilizado para\r\nmedir a quantidade e o fluxo de ar que entra e sai dos pulmões do paciente.</span>\r\nAlterações podem indicar doenças respiratórias como asma ou DPOC.</span><o:p></o:p></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">A</span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><a href=\"https://portaltelemedicina.com.br/blog/laudo-de-espirometria-via-telemedicina\" target=\"_blank\"><strong style=\"border: transparent; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit;\"><span style=\"color: blue; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;espirometria\r\nocupacional</span></strong></a><span style=\"color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;trata de monitorar a saúde respiratória de\r\ntrabalhadores em atividades insalubres para o aparelho respiratório, como em\r\nambientes onde são expostos a poeira ou produtos químicos, já que estão\r\nsujeitos a desenvolver doenças restritivas ou obstrutivas como a fibrose\r\npulmonar.<o:p></o:p></span></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Caso alguma alteração seja identificada no padrão\r\nrespiratório, deve ser iniciada a investigação para identificar as causas.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Esse exame dentro dos processos de Saúde e Segurança do\r\nTrabalho são de extrema importância para manter a saúde do colaborador em dia.\r\nAlém de manter o monitoramento da empresa acerca dos seus colaboradores,\r\nevitando problemas futuros.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Saúde e Segurança do Trabalho é coisa séria, conte com uma\r\nempresa séria e comprometida com você e a sua empresa.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family: Arial, sans-serif; color: rgb(51, 51, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Uma empresa sem acidentes só depende de você.</span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><o:p></o:p></span></p>', 1, '2022-05-17 11:25:03', '2022-05-17 11:25:03', NULL);

