INSERT INTO `blogs` (`id`, `title`, `image`, `abstract`, `highlights`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Visita técnica dos alunos do CEAS', '202004160111105e97dade4cdc5.jpg', 'Fonte: Assessoria de Comunicação', '<p>Alunos do CEAS fazem visita técnica na manhã desta quarta-feira na Getra<br></p>', '<p style=\"text-align: left;\">A Getra recebeu na manhã desta quarta-feira (29), a visita técnica dos alunos do curso de Saúde e Segurança do Trabalho do Ceas Escola Técnica. Uma manhã super proveitosa, onde os alunos puderam conhecer nossos profissionais, como também as nossas instalações e a rotina da nossa empresa, que preza pela competência no trabalho que executa. Com toda certeza os alunos saíram dessa visita com um olhar diferenciado acerca da Saúde e Segurança do Trabalho que foi a profissão escolhida por eles. Nossos colaboradores se sentem lisonjeados em poder colaborar com esses alunos.</p>', 1, '2020-04-16 04:11:10', '2020-08-24 14:07:34', NULL),
(2, 'Lombalgia lidera motivo de afastamento do trabalho', '202004160112405e97db385b91b.jpg', 'Fonte: https://www.contabeis.com.br/', '<p>Incômodo nas costas é o principal motivo que afasta trabalhadores dos seus postos<br></p>', '<p style=\"text-align: left;\">Levantamento do Instituto Nacional do Seguro Social (INSS) aponta crescimento de 6% no volume de afastamento de trabalhadores por doenças ou complicações de saúde. Com mais de 83 mil casos, lombalgia (dor na região lombar) é a principal causa.</p><p style=\"text-align: left;\">A falta de um programa de acompanhamento postural e uso correto dos equipamentos fornecidos pelas empresas estão entre os principais motivos que levam milhares de trabalhadores aos consultórios médicos com dores na região da lombar.</p><p style=\"text-align: left;\">Dados da Organização Mundial de Saúde (OMS) apontam que que lombalgia é a segunda maior causa de visita aos consultórios médicos, perde apenas para dor de cabeça.</p><p style=\"text-align: left;\">\"Na maioria das vezes, especialmente em pacientes jovens e de meia idade, a lombalgia, famosa dor nas costas, é um sintoma de uma contratura muscular ou distensão muscular, que normalmente estão ligadas a coisas muito próximas do nosso dia a dia, como postura inadequada ao desempenhar atividades corriqueiras, como pegar peso de mal jeito sem uma postura adequada da coluna”, afirma&nbsp; Angelo Guarçoni, médico neurocirurgião e de coluna.</p><p style=\"text-align: left;\">Seja por realizar um trabalho repetitivo, excesso de tempo em uma determinada posição ou mesmo forçar um exercício na academia, não é incomum encontrar alguém sofrendo de dores na lombar. Na grande maioria das vezes, esse incômodo é localizado, porém, em pequenos casos, pode ser sintoma de uma doença mais grave, principalmente em idosos.</p><p style=\"text-align: left;\">Uma visita ao consultório logo no início pode ser suficiente para diagnóstico e tratamento adequado, evitando o agravamento do caso. “Só o especialista consegue definir o que é essa dor. Se é uma lombalgia vinda de uma contratura muscular, má postura, ou se é referente a algum outro problema de saúde como pedra nos rins, infecções urinárias ou hérnia de disco”, destaca o médico.</p><p style=\"text-align: left;\">Além da lombalgia, fraturas nos pés, nas mãos, transtornos de discos invertebrais, leiomioma do útero lideram nos motivos que afastam trabalhadores de suas funções.</p>', 1, '2020-04-16 04:12:40', '2020-08-14 14:26:43', NULL),
(3, 'O que é Engenharia de Segurança do Trabalho?', '202004160113535e97db81b5e04.png', 'Fonte: https://www.educamaisbrasil.com.br/', '<p>Saiba mais sobre o curso e o mercado de trabalho dessa profissão<br></p>', '<p style=\"text-align: left;\">O Engenheiro de Segurança do Trabalho é o profissional responsável por coordenar e efetuar análise de projetos a serem implantados, em conjunto com as áreas técnicas, recomendando alterações, visando reduzir ou eliminar os riscos de acidentes e doenças ocupacionais. Além disso, orienta a Comissão Interna de Prevenção de Acidentes (CIPA) das empresas e fornece instruções aos funcionários sobre o uso de equipamentos de proteção individual (EPIs). </p><p style=\"text-align: left;\">O que estudar para ser Engenheiro de Segurança do Trabalho?</p><p style=\"text-align: left;\">Segundo a Lei 7410/85 para exercer a profissão na área, é necessário fazer um curso de graduação em Arquitetura ou Engenharia – nas modalidades civil, eletricista, mecânica e metalúrgica, química, geologia e minas e agrimensura, com duração média de 4 a 5 anos, e depois fazer uma pós-graduação em Engenharia de Segurança do Trabalho. </p><p style=\"text-align: left;\">Durante o curso, o aluno irá se deparar com matérias específicas sobre a integração do homem ao ambiente de trabalho, normas e legislação, prevenção de riscos, ética e cidadania, relação com o Conselho Regional de Engenharia e Agronomia (CREA), dentre outras.</p>', 1, '2020-04-16 04:13:53', '2021-07-06 13:20:35', NULL),
(4, 'Dia dos Engenheiros e TST', '202007131637095f0cb7e541a63.png', 'http://www.protecao.com.br/', 'Dia dos Engenheiros e TSTs é comemorado no dia 27', '<div style=\"text-align: left;\">27 de novembro, é uma data marcante entre os prevencionistas: é o Dia do Técnico e do Engenheiro de Segurança do Trabalho. A data celebra o dia em que ambas as profissões foram regularizadas pelo Ministério do Trabalho por meio da Lei nº 7.410, de 27 de novembro de 1985. Tanto os engenheiros quanto os técnicos de Segurança do Trabalho vêm atuando junto a outros profissionais da área em busca de melhores condições nos ambientes laborais. Embora a lei tenha saído somente na década de 1980, ambos já desempenhavam suas funções muito antes desta data, iniciando timidamente a partir da criação das CIPAs em 1944, ganhando maior impulso com a regulamentação dos SESMTs em 1972 e finalmente com a publicação das NRs em 1978.</div>', 1, '2020-07-13 19:37:09', '2020-08-14 14:26:29', NULL),
(5, 'Dia do Médico do Trabalho', '202007131647475f0cba6317255.png', 'http://revistacipa.com.br/', 'Dia do Médico do Trabalho', '<div style=\"text-align: left;\">Os médicos do trabalho em todo o mundo celebram, nesta sexta-feira, uma data especial para a especialidade. Trata-se do Dia do Médico do Trabalho, comemorado no dia 4 de outubro em homenagem ao nascimento do médico italiano Bernardino Ramazzini (1633-1714).Para a ANAMT, a escolha da data é a consolidação do exercício da profissão. A celebração vem de encontro ao anseio de por em evidência a atuação do médico da área e sua responsabilidade na manutenção de condições ideais de trabalho. Mais do que celebrar a Medicina do Trabalho, o 4 de outubro é dia de honrar o legado de Ramazzini, reafirmando nosso compromisso com esta especialidade médica que lida com as relações entre homens e mulheres trabalhadores e seus respectivos ofícios, visando não somente a prevenção dos acidentes e das doenças do trabalho, mas a promoção da saúde e da qualidade de vida. Há mais de 300 anos, Ramazzini, considerado o precursor da especialidade, começou a pavimentar rumos que seguimos até hoje: o estabelecido de ligações entre determinadas ocupações e as enfermidades sofridas pelas profissionais que as praticavam.</div>', 1, '2020-07-13 19:47:47', '2020-08-14 14:26:13', NULL),
(6, 'Titulo', '202008241121175f43ccdda2eb6.jpg', 'Getra', '<p>Teste</p>', '<p>Teste</p>', 1, '2020-08-24 14:21:17', '2020-08-24 14:22:00', '2020-08-24 11:08:00'),
(7, 'Como prevenir acidentes no trabalho em altura?', '202008241141175f43d18dd82bd.jpg', 'Getra', '<p><span style=\"color: rgb(119, 119, 119); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">A melhor maneira de evitar acidentes é seguindo as disposições da NR 35.</span><br></p>', '<p dir=\"ltr\" style=\"line-height: 1.2; margin-top: 0pt; margin-bottom: 7.2pt;\" id=\"docs-internal-guid-124c5b80-7fff-0fd1-cb31-ad05f7f04cb7\"><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Como prevenir acidentes no trabalho em altura?</span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-weight: 700; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Quando o trabalhador exerce suas atividades em locais que estão acima de 2 metros do nível inferior, seja o solo ou não, é considerado trabalho em altura. O que regula essa área é a Norma Regulamentadora n.º 35 (NR 35). O trabalho realizado sob essas condições tem alguns riscos, como por exemplo quedas de escadas ou andaimes, são comuns, infelizmente. </span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Toda atividade requer cuidados e equipamentos específicos, priorizando a segurança e o bem estar dos colaboradores. A melhor maneira de evitar acidentes é seguindo as disposições da NR 35. O que dará segurança para os funcionários mas também para organização que garante estar cumprindo todas as diretrizes. É essencial que haja capacitação e treinamento de todos os empregados que trabalharão nas atividades em altura. A carga horária deve ser de 8 horas</span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br></span><span style=\"font-size: 11pt; font-family: Arial; color: rgb(119, 119, 119); font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">A NR 35 lista responsabilidades tanto do patrão quanto dos empregados para garantir a proteção de todos que frequentam o local de trabalho. Estas são algumas das obrigações.</span></p>', 1, '2020-08-24 14:41:17', '2020-08-24 14:41:47', '2020-08-24 11:08:47'),
(8, 'Como prevenir acidentes no trabalho em altura?', '202008241153165f43d45c635f8.jpg', 'Getra', '<div style=\"text-align: justify;\"><span style=\"font-size: 12px; color: rgb(119, 119, 119); font-family: Arial;\">Toda atividade requer cuidados e equipamentos específicos, priorizando a segurança e o bem estar dos colaboradores. A melhor maneira de evitar acidentes é seguindo as disposições da NR 35. O que dará segurança para os funcionários mas também para organização que garante estar cumprindo todas as diretrizes. É essencial que haja capacitação e treinamento de todos os empregados que trabalharão nas atividades em altura. A carga horária deve ser de 8 horas</span></div>', '<div style=\"text-align: left;\"><font color=\"#777777\" face=\"Arial\"><span style=\"font-size: 12px;\"><b>Como prevenir acidentes no trabalho em altura? INSERT INTO `blogs` (`id`, `title`, `image`, `abstract`, `highlights`, `description`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(21, 'Eletroencefalograma - EEG', '20220523142547628bc39b063fc.jpg', 'Entenda', '<p>Getra&nbsp;</p>', '<p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">O eletroencefalograma, ou\r\nEEG, é um exame feito para avaliar a atividade elétrica do cérebro, sendo\r\nindicado para identificar alterações neurológicas.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-size: 12pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Normalmente esse exame é\r\nindicado pelo clínico geral ou Neurologista em algumas situações: <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:12.0pt;line-height:\r\n200%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:#404040;mso-fareast-language:PT-BR\">- Diagnosticar epilepsia;<br>\r\n- Acompanhamento da resposta ao tratamento da epilepsia;<br>\r\n- Suspeita de alterações da função cerebral, como a encefalopatia;<br>\r\n- Detecção de inflamações ou intoxicações cerebrais, como a encefalite;<br>\r\n- Investigação de desmaios ou perda de consciência em pessoas que possuem\r\nexames cardíacos normais;&nbsp;<br>\r\n- Identificação de alterações cerebrais após AVC, hemorragia intracraniana ou\r\nsubaracnóide;<br>\r\n- Monitorar a profundidade da anestesia em procedimentos cirúrgicos;<br>\r\n- Monitorar a atividade do cérebro durante uma cirurgia cerebral;<br>\r\n- Induzir o coma terapêutico;<br>\r\n- Detectar alterações da atividade cerebral;<br>\r\n- Detecção de alterações da atividade cerebral, no caso de tumor no cérebro;<br>\r\n- Avaliação de distúrbios do sono;<br>\r\n- Complemento da avaliação de doenças cerebrais ou doenças psiquiátricas.<o:p></o:p></span></p><p class=\"MsoNormal\">\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height: 200%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; line-height: 200%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Quando\r\nrelacionado a Saúde e Segurança do Trabalho </span><span style=\"font-size: 12pt; line-height: 200%; font-family: Arial, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">esse\r\nexame é feito para detectar diversas doenças neurológicas e psiquiátricas.\r\nRealizado nos colaboradores de mesma categoria do ECG.</span> <span style=\"font-size: 12pt; line-height: 200%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Qualquer pessoa pode realizar um\r\neletroencefalograma, não havendo contraindicações absolutas</span>.&nbsp;<span style=\"font-size:12.0pt;line-height:200%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#404040;mso-fareast-language:\r\nPT-BR\"><o:p></o:p></span></p>', 1, '2022-05-23 17:25:47', '2022-05-23 17:25:47', NULL),
(22, 'O ambiente profissional deve ser saudável', '2022053015362962950ead3ac00.jpg', 'Entenda', '<p>Getra</p>', '<p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Um ambiente de\r\ntrabalho saudável estimula os colaboradores a oferecerem o seu melhor, o que\r\nfaz com que a produtividade seja maior. <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Oferecer um\r\nambiente estimulante faz toda a diferença no resultado final e aqui vamos citar\r\nalguns dos benefícios: <o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">- Motiva o\r\ncolaborador<br>\r\n- Diminui a taxa de turnover<br>\r\n- Maior qualidade de vida do profissional<br>\r\n- Estimula o diálogo<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Cabe as\r\nempresas investirem em práticas que proporcionem o bem-estar dos seus\r\ncolaboradores no dia a dia. Um ambiente seguro que transmite o cuidado garante\r\nque os trabalhadores sejam ainda mais produtivos.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Essas práticas são\r\nbenéficas para a empresa, que conta com uma equipe motivada e produtiva. Ambos\r\nos lados saem ganhando.<o:p></o:p></span></p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Conte com uma\r\nConsultoria em Saúde e Segurança do Trabalho para ajudar nesse processo.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\">Conte com a\r\nGetra!!<o:p></o:p></span></p>', 1, '2022-05-30 18:36:29', '2022-05-30 18:36:29', NULL),
(23, 'Principais multas e-Social e SST.', '2023030114042563ff8599c874f.jpg', 'GETRA - Gestão em Segurança do Trabalho', '<p>Destacamos algumas das principais causas de multas do eSocial e seus respectivos valores, considerando alguns eventos, principalmente SST</p>', '<p>Destacamos algumas das principais causas de multas do eSocial e seus respectivos valores, considerando alguns eventos, principalmente SST, são eles:<br style=\"\">📌Não informar admissões – o valor da multa vai de R$800 a R$ 3.000,00 por empregado e pode dobrar de valor em caso de reincidência;<br style=\"\">📌Não comunicar alterações contratuais e cadastrais – multas podem ser de R$ 201,27 até R$402,54 por funcionário;<br style=\"\">📌SST: Não comunicar acidentes de trabalho (não envio do CAT) – multa varia entre o limite mínimo e máximo do salário do funcionário. Se houver reincidência o valor é dobrado;<br style=\"\">📌SST: Não informar riscos do trabalho – multas entre R$ 1.812,87 a R$ 181.284,63;<br style=\"\">📌SST: Não monitorar a saúde do trabalhador (não elaborar o PCMSO) – multas que varia de R$ 1.436,53 a R$ 4.024,42;<br style=\"\">📌SST: Não informar afastamentos temporários – multa fica entre R$1.812,87 a R$181.284,63;<br style=\"\">📌SST: Não comunicar o ASO – a multa varia entre R$402,53 e R$4.025,33.<br style=\"\">Para evitar as multas do eSocial SST, a sua empresa precisa contar com uma assessoria de gestão SST como a GETRA. Entre em contato conosco!<br></p>', 1, '2023-03-01 17:04:25', '2023-03-01 17:04:25', NULL),
(24, 'Checklist do SST e-Social', '2023030114093663ff86d092e60.png', 'GETRA - Gestão em Segurança do Trabalho', '<p><br></p><p>É importante ficar atento aos seguintes documentos de SST obrigatórios para o envio das informações pelo eSocial.<br></p>', '<p>É importante ficar atento aos seguintes documentos de <b>SST </b>obrigatórios para o envio das informações pelo <b>eSocial</b>:<br style=\"\">📌<b>PCMSO </b>– Programa de Controle Médico de Saúde Ocupacional;<br style=\"\">📌<b>AET </b>– Análise Ergonômica do Trabalho;<br style=\"\">📌<b>LTCAT </b>– Laudo Técnico das Condições Ambientais do Trabalho;<br style=\"\">📌<b>PPRA </b>– Programa de Prevenção de Riscos Ambientais;<br style=\"\">📌<b>Laudo de Periculosidade</b>;<br style=\"\">📌<b>Laudo de Insalubridade</b>;<br style=\"\">Precisando de ajuda para garantir que a sua instituição esteja de acordo com a regulamentação vigente? Entre em contato com a GETRA-📞(83)-3321-1446<br></p>', 1, '2023-03-01 17:09:36', '2023-03-01 17:09:36', NULL),
(25, 'Não são todas MEI, ME e EPP que pode emitir a DIR.', '2023030114175663ff88c4683da.png', 'GETRA - Gestão em Segurança do Trabalho', '<p>A <b>DIR </b>é permitida apenas para empresas <b>MEI</b>, <b>ME </b>e <b>EPP </b>grau de risco 1 e 2 *que não identificar riscos físicos, químicos, biológicos para dispensa do <b>PGR </b>e ergonômicos para dispensa do <b>PCMSO</b>.<br style=\"\"><b>*MEI</b> está dispensado de <b>PGR </b>- usa FICHA <b>MEI</b>.<br style=\"\">Para dispensa do <b>PCMSO </b>a regra é a mesma das <b>ME </b>e <b>EPP</b><br></p>', '<p>A <b>DIR </b>é permitida apenas para empresas <b>MEI</b>, <b>ME </b>e <b>EPP</b> grau de risco 1 e 2 *que não identificar riscos físicos, químicos, biológicos para dispensa do <b>PGR </b>e ergonômicos para dispensa do <b>PCMSO</b>.<br style=\"\"><b>*MEI </b>está dispensado de <b>PGR </b>- usa <b>FICHA MEI</b>.<br style=\"\">Para dispensa do <b>PCMSO </b>a regra é a mesma das <b>ME </b>e <b>EPP</b><br style=\"\"><br style=\"\">A quem se destina?<br style=\"\"><br style=\"\">O público-alvo da <u>Ferramenta de Avaliação de Risco </u>do <b>PGR </b>que tiver emitido sua <b>DIR </b>fica dispensado de elaborar o<b> (PGR)</b>, previsto no item 1.5.3.1.1 da NR-1.<br style=\"\">O <u>Microempreendedor Individual</u> <b>(MEI)</b> já está automaticamente dispensado de elaborar o <u>Programa de Gerenciamento de Risco</u><b> (PGR)</b> em razão do item 1.8.1 NR-01.<br style=\"\">As demais empresas *<b>MEI</b>, <b>ME </b>ou <b>EPP</b>, grau de risco 1, 2, 3 e 4, obrigadas a constituir <b>SESMT </b>ficam obrigadas a implementar <b>GRO/PGR</b> normalmente.<br style=\"\"><br style=\"\">Fale conosco: (83) 3201-1446/ (83) 99988-1495<br></p>', 1, '2023-03-01 17:17:56', '2023-03-01 17:17:56', NULL);
